import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";

// @material-ui/icons

// core components
import Header from "components/Header/Header.jsx";
import HeaderLinks from "components/Header/HeaderLinks.jsx";
import Parallax from "components/Parallax/Parallax.jsx";

import landingPageStyle from "assets/jss/material-kit-react/views/landingPage.jsx";

// Sections for this page
import QuestionsSection from "./Sections/QuestionsSection.jsx";

const dashboardRoutes = [];

class QuestionsPage extends React.Component {
  render() {
    const { classes, ...rest } = this.props;
    return (
      <div>
        <Header
          color="transparent"
          routes={dashboardRoutes}
          brand="Memento"
          rightLinks={<HeaderLinks completed={true}/>}
          fixed
          changeColorOnScroll={{
            height: 400,
            color: "black"
          }}
          {...rest}
        />
         <Parallax filter small image={require("assets/img/hola.jpeg")}>
          <div className={classes.container}>
          </div>
        </Parallax>

        <div className={classNames(classes.main, classes.mainRaised)}>
          <div className={classes.container}>
          <div className={classes.section}>
        <GridContainer justify="center">
          <GridItem cs={12} sm={12} md={8}>
            <h2 className={classes.title}>Primero, cuentanos sobre el paciente</h2>

            <p className={classes.title}>Cuentanos información que sea agradable para el paciente.
            Si la respuesta es negativa, desconoces alguna de las respuestas o no estas seguro, deja la respuesta vacía.</p>
            <form>
              <GridContainer>

              <GridItem xs={12} sm={10} md={12}>
              <p>hola</p>

              <input 
              style={{display:'none'}}
              type="file" 
              onChange={this.fileSelectedHandler}
              ref = {fileInput => this.fileInput = fileInput}
              />
              <Button 
                  onClick={() => this.fileInput.click()}
                  round size="normal"
                  color="success"
                  >Sube una foto del paciente
              </Button>

              <Button 
                  round size="normal"
                  color="success"
                  >Sube una foto familiar
              </Button>


                <CustomInput
                  label="Label"
                  labelText="¿Ciudad dónde vive?"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="¿Departamento dónde vive?"
                  id="department"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="¿Barrio dónde vive?"
                  id="neighborhood"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="¿Dónde nació?"
                  id="birthCity"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="Profesion que ejerció o ejerce"
                  id="profession"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="Nombre del último lugar dónde estudió escuela/universidad/instituto"
                  id="school"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="Sobrenombre"
                  id="nickname"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

